package isola.model.ext.grid;import isola.helpers.JsHelper;import isola.model.ext.base.Observable;/** *  * <p> * Abstract base class for grid SelectionModels. It provides the interface that * should be *  * implemented by descendant classes. This class should not be directly * instantiated. * </p> *  *  *  * @author Umut Gokbayrak */public class AbstractSelectionModel extends Observable {	private static final long serialVersionUID = -792957505596267009L;	private static final String TAG = "Ext.grid.AbstractSelectionModel";		public AbstractSelectionModel() {		super();	}		@Override	protected void _postProcessToString() {		super._postProcessToString();	}		@Override	public String toString() {		_postProcessToString();		return "new " + TAG + "(" + JsHelper.printJsObject(this) + ")";	}}